class Solution:
    def maxOperations(self, s: str) -> int:
        res = 0
        shift = 0
        for i in range(len(s)-2,-1,-1):
            if s[i]=='1':
                if s[i+1]=='1':
                    res+=shift
                else:
                    shift += 1
                    res+=shift
        return res
